import React from 'react';

const Login: React.Component = () => {
    return(
        <div className="login">
            This ig login Page!
            <ul>
                <li><a href="./main">Main</a></li>
                <li><a href="./regestration">Regestration</a></li>
            </ul>
        </div>
    )
}
export default Login;
